import React ,{Component} from 'react';
import Header from './Header';

class MemeGenerator extends Component{
    constructor(){
        super();
        this.state={
            topText:"",
            bottomText:"",
            randomImg:"http://i.imgflip.com/1bij.jpg"
        }
    }


    componentDidMount(){
        fetch("https://api.imgflip.com/get_memes")
        .then(res=>res.json())
        .then(data=>data.mems)
    }

    render(){
        return(
            <Header />
        )
    }
}

export default MemeGenerator;
